import React, {Component} from 'react';
import  {Link} from 'react-router-dom';
import axios from 'axios';

 class Managerlist extends Component
 {
     
   async  componentDidMount(){
         const res=await axios.get('http://localhost:8000/api/managerlist');
    console.log(res); 
    
   }
  render(){

    var manager_HTML_TABLE ="";
    if(this.state.loding){
     manager_HTML_TABLE = <tr> <td colSpan="7"> <h2>loding....</h2></td></tr>
 
    }
 
    else{
     manager_HTML_TABLE=
     this.state.managers.map((item)=>{
         return(
  <tr key={item.id}>
      <td>{item.name}</td>
      <td>{item.email}</td>
      <td>{item.phone}</td>
      <td>{item.adress}</td>
      <td>{item.password}</td>
      <td>
          <link to={'edit-manager/${item.id'}className="btn btn-success btn-sm">Edit</link>
      </td>
      <td>
          <button type="button" className="btn btn-success btn-sm">Delete</button>
      </td>
 
  </tr>
         );
     })
 
    }

    return(

    <div className="container">
                <div className="row">
                     <div className="col-md-12">
                         <div className="card">
                             <div className="card-header">
                                    <h4> 
                                      Home page
                                       <Link to={'addmanager'} className="btn btn-primary btn-sm float-end">Add Manager</Link>
                                       <Link to={'managerlist'} className="btn btn-primary btn-sm float-end">Manager list</Link>
                                    </h4>
                            </div>
                            <div className="card-body">
                                <table className="table table-bordered table-striped">
                                    <thead>
                                       <tr>
                                           <th>Id</th>
                                           <th>Name</th>
                                           <th>email</th>
                                           <th>phone</th>
                                           <th>adress</th>
                                           <th>Edit</th>
                                           <th>Delete</th>
                                       </tr>
                                    </thead>
                                    <tbody>
                                    {manager_HTML_TABLE}
                                    </tbody>
                                </table>
                            </div>
                     </div>
                 </div>
            </div>
    </div>

    )
  }
 }
 export default Managerlist;
